import React from 'react';

const Navbar = () => {
    return (
        <div className="uk-container">
            <div className="uk-navbar-left">
                <a className="uk-navbar-toggle" uk-navbar-toggle-icon href="">Options</a>
            </div>


        </div>
    );
}


export default Navbar;
